//import { useState, useEffect } from "react";
import SneakersCard from "../component/sneakersCard";
import "../style/menWoman.css";

function Men() {
	return (
		<div className='main_container'>
			<div className='left_section'></div>
			<div className='right_section'>
				<div className='SneakersCard_container'>
					<SneakersCard
						price='111'
						rating={3}
						img='https://images.unsplash.com/photo-1603808033587-935942847de4?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1412&q=80'
						promo='SALE'
					/>
				</div>
			</div>
		</div>
	);
}

export default Men;
